import React, { Component } from 'react'

export default class Mountain extends Component {
  render() {
    return (
      <div className="mountain">
        <img src={madeForThe} className="mountain__head"/>
        <img src={mountainIcon} className="mountain__icon"/>
      </div>
    )
  }
}
